var mb_UUID, mb_storage, mb_fireUnique = false, mb_isRunning=false, mbRTVal="";


function mblog(action){
	if(window.console && window.console.log){console.log("[MBRIX] " +action);}
}

function mb_initRT(){
	mblog("mb_initRT");
	var keypair={};
	var q = document.getElementById("mb_rtg").src.split("?")[1];
	q = q.split("&");

	for (var i=0;i<q.length;i++) {
		var qq=q[i].split("=");
		var key = (qq[0] === "k") ? "key" : "value";
		keypair[key] = qq[1]; 
	}

	mblog("mb_initRT:" + keypair);

	try{
		mb_applyRT(keypair);
	}catch(e){
		mblog("Error saving cookie!");
	}

}

function mb_applyRT(keyval){
	mblog("mb_applyRT");

	var mbRT = (mbrix_swfstore.getValueOf("mb_rt") === null) ? [] : mbrix_swfstore.getValueOf("mb_rt");
	mbRT.push(keyval);
	mblog(mbRT.length);
	if(mbRT.length > 5){
		mbRT.splice(0,1);
	}
	
	mbrix_swfstore.setItem("mb_rt", mbRT);
	mblog(mbRT);
}



