YAHOO.util.Event.onDOMReady(function() {
	try{
		clearTimeout(byPassYahoo);
		setupMbrixStorage();
	}catch(e){
		//handle error
		mblog("yahoo domready error");
	}
	
});


function onContentReady(event){
	mblog("mb_storage swfstore ready");
	mb_initRT();
}

function setupMbrixStorage(){
	mblog("setupMbrixStorage");
	var ad_page = document.body;

	var swf_div = document.createElement("DIV");
	swf_div.id = "mb_swfstoreContainer";
	swf_div.style.height = "1px";
	swf_div.style.width = "1px";
	ad_page.appendChild(swf_div);
	
	YAHOO.util.SWFStore.SWFURL=document.location.protocol + "//mediabrix.hs.llnwd.net/o38/v1_4/swfstore.swf";
	mbrix_swfstore = new YAHOO.util.SWFStore("mb_swfstoreContainer", true, false);
	mbrix_swfstore.addListener("contentReady", onContentReady);	
}

//If Yahoo SWF storage fails to load, call mb_metrics.init after 10 seconds.
var byPassYahoo = setTimeout(
	function(){
		mblog("byPassYahoo");
		
		try{			
			setupMbrixStorage();

		}catch(e){
			//handle error
			mblog("failed to setupMbrixStorage cookie")
		}

	},5000);

